class licenseChecker(object):
    def __init__(self,effectName,privateNumber):
        self.effectName = ("".join(effectName.split())).lower()
        self.privateNumber = privateNumber
        self.licenser = self.__getLicenserTool()
        self.validator = self.__getValidatorTool()

    def removeLicense(self):
        retVal = self.licenser.execute([self.effectName,'-'])
        out = retVal[0]
        err = retVal[1]
        if out != "" or err != "":
            raise LicenseError("could not remove license" + str(out) + str(err)) 
    
    def isTempSerial(self,licenseString):
        tempSerialPattern = re.compile(r"^[A-Z]{2}[A-Z0-9]{30}$")
        result =  tempSerialPattern.match(licenseString) != None
        return result
        
    def installLicense(self,licenseString):
        stippedLicenseString = licenseString.strip()
        retVal = self.licenser.execute([self.effectName,stippedLicenseString])
        out = retVal[0]
        err = retVal[1]
        if err != "":
            raise LicenseError("could not install license" + str(out) + str(err)) 

    def hasValidLicense(self):
        licenseInfo = self.getLicenseInfo()
        return licenseInfo['status'] == "valid"

    def getLicenseInfo(self):
        retVal = self.validator.execute([self.effectName,self.privateNumber])
        out = retVal[0]
        err = retVal[1]
        if err != "":
            raise LicenseError("could not validate license" + str(out) + str(err)) 
        licenseInfo = self.__parseLicenseInfo(out)
        return licenseInfo
    
    def __parseLicenseInfo(self,data):
        pattern = re.compile(r"^status:\s*([^\r\n]*)\s*first name:\s*'(.*)'\s*last name:\s*'(.*)'\s*number of user licenses:\s*(\d*)\s*license type:\s*'(.*)'\s*pluginID")
        parse = pattern.match(data)
        
        if parse == None:
            raise Exception("invalid licensing info")
        
        licenseInfo = {
            'status' : parse.group(1),
            'first name' : parse.group(2),
            'last name' : parse.group(3),
            'number of user licenses' : parse.group(4),
            'license type' : parse.group(5),
        }
        return licenseInfo

