class binaryTool(object):
    """a commandline tool represented as a binary string. Can be copied to a temp file and executed"""
    def __init__(self,binStringB64):
        self.binString = binStringB64
        self.filePath = None
        
    def execute(self,arguments):
        self.__createFile()
        
        if not self.filePath:
            return
        arguments.insert(0,self.filePath)
        p = Popen(arguments,stdout=PIPE, stderr=PIPE)
        result = p.communicate() #result is a tuple of strings (stdout, stderr)

        self.__deleteFile()
        
        return result
        
    def __createFile(self):
        (fd, filePath) = mkstemp(suffix='', prefix='tmp', dir=None, text=False)
        file = os.fdopen(fd,"wb")
        file.write(self.binString)
        file.close()
        os.chmod(filePath,stat.S_IRUSR | stat.S_IWUSR | stat.S_IXUSR)
        self.filePath = filePath
         
    def __deleteFile(self):
        if self.filePath:
            os.remove(self.filePath)
            self.filePath = None

class licenseManager(object):
    def __init__(self, toolName, toolVersion, effectName, privateNumber):
        self.toolName = toolName
        self.toolVersion = toolVersion
        self.myLicenseTool = licenseChecker(effectName, privateNumber)
        self.localizer = Localizer()

    def _handleTempSerial(self, licenseCode, toolName):
        exchangeUrl = "https://license.aescripts.com/exchange/?serial="+licenseCode    
        confirmMessage = self.localizer.strTempSerialMessage % exchangeUrl
        if c4d.gui.QuestionDialog(confirmMessage):
            webbrowser.open_new_tab(exchangeUrl)

    def _showLicensingMessage(self, isValidLicense):
        if isValidLicense:  # Registration Successful
            c4d.gui.MessageDialog(self.localizer.strRegSuccess +  " v" + self.toolVersion)
            return True
        else:   # License code is not valid
            c4d.gui.MessageDialog(self.localizer.strInvalidCode + "\n\n" + self.localizer.strNewLicenseFormat + "\n\n" + self.localizer.strContactSupport)
            return False

    def checkLicense(self, quiet):
        if quiet:
            return self.myLicenseTool.hasValidLicense()
        if self.myLicenseTool.hasValidLicense():
            return True
        return self._showLicenseModal()

    def _showLicenseModal(self):
        while True:
            licensing = licenseWindow(self.toolName, self.toolVersion, self.localizer, self.myLicenseTool.getLicenseInfo(), self.removeLicense)
            licensing.Open(dlgtype=c4d.DLG_TYPE_MODAL)
            if licensing.cancelPressed or licensing.removePressed:
                return None;

            newLicense = licensing.userInput
            if not newLicense or newLicense.lower().strip() == "trial":
                c4d.gui.MessageDialog(self.localizer.strTrialWindowMsg)

                return False

            if newLicense.find("*") != -1 and not newLicense.startswith(strHeader):
                c4d.gui.MessageDialog(self.localizer.strWrongProduct + "\n\n" + self.localizer.strContactSupport)
                continue

            if self.myLicenseTool.isTempSerial(newLicense):
                self._handleTempSerial(newLicense, self.toolName)
            else:
                self.myLicenseTool.installLicense(newLicense)
                if self.myLicenseTool.hasValidLicense():
                    self._showLicensingMessage(True)
                    return True
                else:
                    self._showLicensingMessage(False)

    def showLicense(self):
        self._showLicenseModal()

    def removeLicense(self):
        self.myLicenseTool.removeLicense()

    def getLicenseInfo(self):
        info = self.myLicenseTool.getLicenseInfo()
        if info["status"] == "valid":
            return self.localizer.strRegistrationInfo % (info["first name"], info["last name"], info["license type"], info["number of user licenses"])
        else:
            return self.localizer.strRunningTrialMsg

class licenseWindow(c4d.gui.GeDialog):

    TEXTBOX_ID          = 5000;
    RETRIEVE_LICENSE_ID = 5001;
    CANCEL_ID           = 5002;
    OK_ID               = 5003;
    REMOVE_LICENSE_ID   = 5004;

    def __init__(self, name, version, localizer, licenseInfo, callbackOnRemove):
        self.name = name
        self.version = version
        self.userInput = ""
        self.localizer = localizer
        self.licenseInfo = licenseInfo
        self.callbackOnRemove = callbackOnRemove

        self.cancelPressed = False
        self.removePressed = False

    def CreateLayout(self):
        self.SetTitle(self.localizer.strTrialWelcomeHeader + " v" + str(self.version));

        self.GroupBegin(9999, c4d.BFH_SCALEFIT, cols=1, rows=1, title="Main Group")   # initw=600, inith=10
        self.GroupBorderSpace(10, 10, 10, 10)

        if self.licenseInfo['status'] == "valid":
            self.AddStaticText(9999, c4d.BFH_LEFT, 0, 0, "License is " + self.licenseInfo['status'] + ".")      # License is valid.
            self.AddStaticText(9999, c4d.BFH_LEFT, 0, 0, self.localizer.strRegistrationInfo % (self.licenseInfo["first name"], self.licenseInfo["last name"], self.licenseInfo["license type"], self.licenseInfo["number of user licenses"]))
        else:
            self.AddStaticText(9999, c4d.BFH_LEFT, 0, 0, self.localizer.strTrialWelcomeMsg)
            self.AddEditText(self.TEXTBOX_ID, c4d.BFH_SCALEFIT)
            self.SetString(self.TEXTBOX_ID, "Trial")

        self.GroupBegin(9999, c4d.BFH_SCALEFIT, cols=2, rows=1, title="Buttons")
        self.GroupBorderSpace(0, 10, 0, 0)

        self.GroupBegin(9999, c4d.BFH_SCALEFIT, cols=1, rows=1, title="Left - Retrieve License")
        if self.licenseInfo['status'] == "valid":
            self.AddButton(self.REMOVE_LICENSE_ID, c4d.BFH_LEFT, 140, 15, self.localizer.strRemoveLicBtn)
        else:
            self.AddButton(self.RETRIEVE_LICENSE_ID, c4d.BFH_LEFT, 140, 15, self.localizer.strRetrieveLic)
        self.GroupEnd()     # close Left - Retrieve License

        self.GroupBegin(9999, c4d.BFH_RIGHT, cols=2, rows=1, title="Two Buttons")
        if self.licenseInfo['status'] == "valid":
            self.AddButton(self.CANCEL_ID, c4d.BFH_LEFT, 60, 15, self.localizer.strClose)
            # pass
        else:
            self.AddButton(self.CANCEL_ID, c4d.BFH_LEFT, 60, 15, self.localizer.strCancel)
            self.AddButton(self.OK_ID, c4d.BFH_LEFT, 60, 15, "OK")
        self.GroupEnd()     # close Two Buttons
        self.GroupEnd()     # close Buttons
        self.GroupEnd()     # close Main Group

        return True;

    def Command ( self, id, msg ):
        # User pressed RETRIEVE LICENSE button
        if id == self.RETRIEVE_LICENSE_ID:
            self.response = c4d.gui.QuestionDialog(self.localizer.strWebWarning)
            if self.response == True:
                webbrowser.open_new_tab(retrieveUrl)

        # User pressed RETRIEVE LICENSE button
        if id == self.REMOVE_LICENSE_ID and self.callbackOnRemove is not None:
            if c4d.gui.QuestionDialog(self.localizer.strRemoveLicMsg):
                self.callbackOnRemove()
                self.removePressed = True
                self.cancelPressed = False
                self.Close()

        # User pressed CANCEL or CLOSE button
        if id == self.CANCEL_ID or msg.GetLong(c4d.BFM_ACTION_ID) == 2:
            self.removePressed = False
            self.cancelPressed = True
            self.Close()

        # User pressed OK button
        if id == self.OK_ID or msg.GetLong(c4d.BFM_ACTION_ID) == 1:
            self.removePressed = False
            self.cancelPressed = False
            self.userInput = self.GetString(self.TEXTBOX_ID)
            self.Close()

        return True

