    def _interfaceLanguage(self):
        languageIndex = 0
        language = c4d.GeGetLanguage(languageIndex)

        if language == None:
            return None
            
        while language["default_language"] == False:
            languageIndex = languageIndex + 1
            language = c4d.GeGetLanguage(languageIndex)
            if language == None:
                return None
            
        #print "Default Language: ", languageIndex, language["extensions"], language["name"], language["default_language"]
        return language["extensions"]

    def get(self, en, de=None, fr=None, es=None, cn=None, cz=None, it=None, jp=None, kr=None, pl=None, ru=None):
        if self.defaultLanguage == "US":
            return en
        if self.defaultLanguage == "DE" and de is not None:
            return de
        if self.defaultLanguage == "FR" and fr is not None:
            return fr
        if self.defaultLanguage == "ES" and es is not None:
            return es
        if self.defaultLanguage == "CN" and cn is not None:
            return cn
        if self.defaultLanguage == "CZ" and cz is not None:
            return cz
        if self.defaultLanguage == "IT" and it is not None:
            return it
        if self.defaultLanguage == "JP" and jp is not None:
            return jp
        if self.defaultLanguage == "KR" and kr is not None:
            return kr
        if self.defaultLanguage == "PL" and pl is not None:
            return pl
        if self.defaultLanguage == "RU" and ru is not None:
            return ru
        return en

